#inaysnewdiscoveries of locally made products!

I’m a big fan of #localproducts and I#supportSMEs kaya naman I want to share my recent discovery of the OTOP Hub in Alabang Town Center. 
OTOP means One Town One Place, it’s a one stop shop collaboration with DTI NCR and ATC that aims to promote and support our Small and Medium Enterprises (SMEs) and the Group from Association of Filipino Franchisers Inc. (AFFI).

They have 20+ merchants with different varieties of #GawangPinoy products and among these brands are Cleeneco, M2 Lactation Club, NaturEarth, Aircon In A Bottle by Scents, Tablea Batirol, Nayong Kalikasan Organic Farm and the list goes on .

For more details, visit their official Website: https://www.otophub.ph

Let’s support and love our own Gawang Pinoy products na perfect din for gift especially sa mga health conscious dahil me Keto section sila. Definitely #inaysrecommended 😉👍

📍OTOP Hub ATC is located at the Ground Floor, near Western Union, Theatre road entrance.

